webpackJsonp([76],{349:function(e,a){e.exports={data:{config:{siteMetadata:{title:"Bricolage",author:"Kyle Mathews"}},markdown:{id:"/Users/kylemathews/programs/blog/pages/2009-04-11---video-and-slides-my-presentation-druplacon-dc-2009/index.md",bodyHTML:'<p>I had the amazing opportunity to present this past March at <a href="http://dc2009.drupalcon.org/">Drupalcon DC 2009</a> on my research and work on <a href="https://island.byu.edu">https://island.byu.edu</a></p>\n<p>It was by far the largest crowd I\'ve ever presented (400) and the longest (1 hour) but I think it turned out pretty well -- no rotten tomatoes anyways -- and I really enjoyed the experience. The <a href="http://dc2009.drupalcon.org/session/building-advanced-social-networks-large-us-university">bulk of my talk</a> was on how to design effective effective social networks pulling from my blog posts earlier this year on <a href="/how-design-social-networking-site-using-social-objects">building social networks</a> with <a href="/what-are-social-objects">social objects</a>.</p>\n<h3>Slides:</h3>\n<p>\n  <iframe src="http://www.slideshare.net/slideshow/embed_code/1108515" width="427" height="356" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" style="border:1px solid #CCC; border-width:1px 1px 0; margin-bottom:5px; max-width: 100%;" allowfullscreen> </iframe>\n</p>\n<h3>Video:</h3>\n<p>The session was also recorded. You can <a href="http://www.archive.org/details/DrupalconDc2009-BuildingAdvancedSocialNetworksAtALargeU.s.University">download the video at archive.org.</a></p>\n',frontmatter:{readNext:null,title:"Video and slides from my presentation at Druplacon DC 2009",tags:["drupal","elearning2.0","island","social networking","presentation","social learning","drupalcon"],date:"April 11, 2009"}}},pathContext:{path:"/video-and-slides-my-presentation-druplacon-dc-2009/",component:"/Users/kylemathews/programs/blog/pages/blog-post.js"}}}});
